import React, { Component } from 'react';
import {BrowserRouter, Route, Link} from 'react-router-dom';
import './App.css';

class Header extends React.Component {	

render(){
	return(
<BrowserRouter>
<div className='App-logo'>
<Link to="/"><img src = 'https://mwcm.nyt.com/.resources/mkt-wcm/dist/libs/assets/img/logo-nyt-header.svg' alt = 'logo'></img></Link>
</div>
</BrowserRouter>
		)
}

}

export default Header;
